import React, { Component } from "react";
import { Link } from 'react-router-dom';
import { withRouter } from 'react-router-dom';
import { connect } from 'unistore/react';
import { actions } from '../store';

class MyCartPage extends Component {
    render() {
        // if ((!this.props.is_login) && (this.props.userStatus !== "pembeli")) {
        //     this.props.history.push('/')
        // }

        return (
            <div class="container my-5">
                <div class="row">
                    <div class='col-12 col-md-8'>
                        <div class="card">
                            <div class="container">
                                <div class="row">
                                    <aside class="col-md-3 col-12 border">
                                        <article class="gallery-wrap">
                                            <img src="" height="100px" />
                                        </article>
                                    </aside>
                                    <aside class="col-md-8 col-12">
                                        <article class="col text-left">
                                            <span class="title mt-5">namaProduk}</span>
                                            <div class="">
                                                <var class="price p ">
                                                    <span class="currency">Rp</span>
                                                    <span class="num"> harga}</span>
                                                    <span class="">Quantity </span>

                                                </var>
                                            </div>
                                        </article>
                                        <div class='col'>
                                            <a href="#" class="btn btn-danger float-right my-auto"> <i class="fas fa-trash-alt"></i></a>
                                        </div>
                                    </aside>

                                </div>
                            </div>
                        </div>
                    </div>
                    <div class="col-md-4 col-12">
                        <dl class="row p-2 pt-3">

                            <dt class="col-6">Total Payment</dt>
                            <dd class="col-6">Rp </dd>

                        </dl>
                        <hr />

                    </div>
                </div>
            </div>
        );
    }
}

export default connect('is_login, userStatus', actions)
    (withRouter(MyCartPage));
